var Niyama = {
  "name": "Shaucha",
  "meaning": "Pureness",
  "about": "Shaucha means Pureness. Pureness is basically good vibes void of negativity. "
}
class Niyama1 extends Component {
    render() {

      return (
        <div className="NiyamaContainer">
          <p className="Niyama">{Niyama.about}
          </p>
        </div>
      );
    }
  }

export default Niyama1;
